import React, { useEffect, useState } from 'react';
import axios from 'axios';

const FulfillRequestsPage = () => {
  const [requests, setRequests] = useState([]);
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetchRequests();
  }, []);

  const fetchRequests = async () => {
    try {
      const res = await axios.get('http://localhost:5050/api/requests/pending');
      setRequests(res.data);
    } catch (err) {
      console.error('Error fetching requests:', err);
    }
  };

  const handleAction = async (id, action) => {
    try {
      await axios.put(`http://localhost:5050/api/requests/${action}/${id}`);
      setMessage(`Request ${action}ed successfully.`);
      fetchRequests();
    } catch (err) {
      console.error(`Error trying to ${action} request:`, err);
      setMessage(`Failed to ${action} request.`);
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.header}>ðŸ“¬ Fulfill Requests</h2>
      {message && <p style={styles.message}>{message}</p>}

      {requests.length === 0 ? (
        <p style={styles.noRequests}>No pending requests found.</p>
      ) : (
        <table style={styles.table}>
          <thead>
            <tr style={styles.tableHeader}>
              <th style={styles.th}>Item</th>
              <th style={styles.th}>Quantity</th>
              <th style={styles.th}>Requested By</th>
              <th style={styles.th}>Actions</th>
            </tr>
          </thead>
          <tbody>
            {requests.map((req) => (
              <tr key={req._id}>
                <td style={styles.td}>{req.itemName || req.itemId?.name || 'Unknown'}</td>
                <td style={styles.td}>{req.quantity}</td>
                <td style={styles.td}>{req.requestedBy}</td>
                <td style={styles.td}>
                  <button
                    onClick={() => handleAction(req._id, 'approve')}
                    style={styles.approveBtn}
                  >
                    Approve
                  </button>
                  <button
                    onClick={() => handleAction(req._id, 'reject')}
                    style={styles.rejectBtn}
                  >
                    Reject
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

const styles = {
  container: {
    padding: '30px',
    fontFamily: 'Arial, sans-serif',
    background: 'linear-gradient(to right, #0f2027, #203a43, #2c5364)',
    minHeight: '100vh',
    color: '#fff',
  },
  header: {
    fontSize: '28px',
    fontWeight: 'bold',
    marginBottom: '20px',
    color: '#ffffff', // neon teal to match âœ… themed header
    display: 'flex',
    alignItems: 'center',
    gap: '10px',
  },
  message: {
    backgroundColor: '#cce7ff', // soft light blue background
    color: '#004080',           // deep blue text
    padding: '10px 16px',
    borderRadius: '6px',
    fontWeight: '600',
    marginBottom: '20px',
    border: '1px solid #99ccff',
  },
  noRequests: {
    backgroundColor: '#fff3cd',
    color: '#856404',
    padding: '10px',
    borderRadius: '5px',
    fontWeight: '500',
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
    marginTop: '20px',
    backgroundColor: '#fff',
    boxShadow: '0 0 10px rgba(0,0,0,0.1)',
    borderRadius: '6px',
    overflow: 'hidden',
    color: '#000',
  },
  tableHeader: {
    backgroundColor: '#003366',
    color: '#fff',
    textAlign: 'left',
  },
  th: {
    padding: '12px',
    fontWeight: 'bold',
  },
  td: {
    padding: '12px',
    borderBottom: '1px solid #ddd',
  },
  approveBtn: {
    backgroundColor: '#007bff',
    color: '#fff',
    padding: '6px 12px',
    border: 'none',
    borderRadius: '4px',
    cursor: 'pointer',
    marginRight: '6px',
  },
  rejectBtn: {
    backgroundColor: '#dc3545',
    color: '#fff',
    padding: '6px 12px',
    border: 'none',
    borderRadius: '4px',
    cursor: 'pointer',
  },
};

export default FulfillRequestsPage;
